import React from 'react'
import {
    PieChart,
    Pie,
    ResponsiveContainer,
    Tooltip
} from 'recharts'


const data01 = [
    {
      "name": "Mujeres",
      "value": 400
    },
    {
      "name": "Hombres",
      "value": 300
    },
    {
      "name": "No binario",
      "value": 300
    },
    {
      "name": "Otros",
      "value": 200
    }
  ];



export default function CircularGraph() {
  return (
    <ResponsiveContainer width={'99%'} height={300}>
      <PieChart width={400} height={400}>
        <Pie dataKey="value" isAnimationActive={false} data={data01} cx={200} cy={200} outerRadius={80} fill="#8884d8" label />
        <Tooltip />
      </PieChart>
    </ResponsiveContainer>
  );
}
